import BoardMembersComponent from "./BoardMembersComponent";
import useStore from '../../../stores/useStore';
import shallow from 'zustand/shallow';
import { useEffect } from "react";

const getState = state => [
    state.directorList,
    state.getDirectors,
    state.set
];

const BoardMembers = () => {
    const [directorList, getDirectors] = useStore(getState, shallow);

    useEffect(()=>{
        getDirectors();
    }, [])

    const args = {
        directorList,
        setDirector: directorlist => {
            setDirectors([{property: "directorlist", value: directorlist}])
        }
    };
    return <BoardMembersComponent {...args} />
}

export default BoardMembers;
